package se.lnu.http;

import java.io.File;

public class HTTPServerConsole {
	private ConsoleView view;
	private ServerFactory factory;

	public HTTPServerConsole(ConsoleView view, ServerFactory factory ) {
		this.view = view;
		this.factory = factory;
	}

	/**
	 * @param args
	 * @throws Exception 
	 */
	public static void main(String[] args) throws Exception {
		ConsoleView view = new ConsoleView(args);
		ServerFactory factory = new ServerFactory();
		HTTPServerConsole server = new HTTPServerConsole(view, factory);
		server.runConsole();
		
		
	}

	void runConsole() throws Exception {
		
		try {
			Port port = view.getPort();
			File sharedDirectory = view.getDirectory();
			HTTPServer server = factory.create(port, sharedDirectory, view);
			
			server.start();
			
			while(true) {
				if (view.doStop()) {
					server.stop();
					break;
				}
			}
			
		} catch (InvalidPortException e) {
			view.showhelp();
		}
	}

}

package se.lnu.http;

import java.io.File;
import java.io.IOException;

public class HTTPServer {

	
	private HTTPServerObserver view;
	
	private Port port;
	private AcceptThread acceptThread;

	public HTTPServer(Port port, File sharedDirectory, HTTPServerObserver view) {
		this.view = view;
		view.serverConstructed();
		this.port = port;
	}

	public void start() throws IOException {
		
		acceptThread = new AcceptThread(port, view);
		
		acceptThread.start();
		
		view.serverStarted();
	}

	public void stop() throws NotStartedException, InterruptedException, IOException {
		if (acceptThread == null)
			throw new NotStartedException();
		
		acceptThread.stopme();
		
		while(acceptThread.isAlive()) {
			Thread.sleep(100);
		}
		
		
		view.serverStopped();
		
		acceptThread = null;
	}

}

package se.lnu.http;

import java.io.BufferedReader;
import java.io.BufferedWriter;
import java.io.IOException;

public class HTTPGetProtocoll {
	private int contentlength;

	String doGet(String hostName, String file,
			BufferedWriter outWriter, BufferedReader reader) throws IOException {
		outWriter.write("GET " + file + " HTTP/1.1\r\nHost: " + hostName + "\r\n\r\n");
		outWriter.flush();
		StringBuilder data = new StringBuilder();
		readHeader(reader, data);
		readBody(reader, data);
		return data.toString();
	}

	private void readBody(BufferedReader reader, StringBuilder data) throws IOException {
		for (int i = 0; i < contentlength; i++) {
			data.append((char)reader.read());
		}
	}

	private void readHeader(BufferedReader reader, StringBuilder data)
			throws IOException {
		
		String statusLine = reader.readLine();
		data.append(statusLine);
		data.append("\r\n");
		
		//read header lines
		
		while (true) {
			String lineRead = reader.readLine();
			data.append(lineRead);
			data.append("\r\n");
			if (lineRead == null || lineRead.equals("\r\n") || lineRead.equals("")) {
				break;
			}
			if (lineRead.startsWith("Content-Length:")) {
				String number = lineRead.substring(16);
				contentlength  = Integer.parseInt(number); 
			}
			
		}
	}
}

package se.lnu.http;

import java.io.BufferedReader;
import java.io.File;
import java.io.IOException;
import java.io.InputStreamReader;

public class ConsoleView implements HTTPServerObserver {
	static final String HELP_TEXT = "Enter a valid port 1-65535 and a optional URL";
	static final String SERVER_CONSTRUCTED = "HTTP Server object constructed";
	static final String SERVER_STARTED = "HTTP Server started";
	static final String SERVER_STOPPED = "HTTP Server stopped";
	static final String SERVER_ACCEPT_THREAD_STOPPED = "HTTP Server Accept thread stopped";
	static final String STARTED_CLIENT = "Started Client";
	static final String WAIT_FOR_ACCEPT = "Accept";
	
	private String[] args;
	
	
	
	public ConsoleView(String[] args) throws WrongNumberOfArgumentsException {
		if (args.length > 2 || args.length < 1) {
			throw new WrongNumberOfArgumentsException();
		}
		
		this.args = args;
		
	}

	public Port getPort() throws InvalidPortException {
		int port;
		try {
			port = Integer.parseInt(args[0]);
		} catch (Exception e) {
			throw new InvalidPortException("not an integer argument");
		}
		Port p = new Port(port);
		
		return p;
	}

	
	public void showhelp() {
		System.out.print(HELP_TEXT);
		
	}
	
	

	public File getDirectory() throws NotADirectoryException {
		File directory;
		try {
			directory = new File(args[1]);//may throw nullpointerexception
			
			
			if (directory.exists() == false) {
				throw new NotADirectoryException("directory does not exists");
			}
			if (directory.isDirectory() == false) {
				throw new NotADirectoryException("url is not a directory");
			}
			
		} catch (Exception e) {
			throw new NotADirectoryException(e);
		}
		
		
		return directory;
	}

	public boolean doStop() throws IOException {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		
		String line = br.readLine();
		if (line.equals("stop")) {
			return true;
		}
		
		return false;
	}
	
	@Override
	public void serverConstructed() {
		System.out.println(SERVER_CONSTRUCTED);
		
	}

	@Override
	public void serverStarted() {
		System.out.println(SERVER_STARTED);
		
	}

	@Override
	public void serverStopped() {
		System.out.println(SERVER_STOPPED);
		
	}

	@Override
	public void closedAccept() {
		System.out.println(SERVER_ACCEPT_THREAD_STOPPED);
		
	}

	@Override
	public void startedClient() {
		System.out.println(STARTED_CLIENT);
		
	}

	@Override
	public void waitForClient() {
		System.out.println(WAIT_FOR_ACCEPT);
		
	}

	

	
}

package se.lnu.http;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.net.Socket;

public class ClientThread extends Thread{
	
	
	private Socket clientSocket;

	public ClientThread(Socket clientSocket) {
		this.clientSocket = clientSocket;
	}
	
	public void run() {
		 
		try {
			PrintWriter out = new PrintWriter(clientSocket.getOutputStream(), true);
			BufferedReader in = new BufferedReader(new InputStreamReader(clientSocket.getInputStream()));
			
			String content = "<html><body><h1>404</h1></body></html>";
			
			out.write("HTTP/1.0 404 Not Found\r\n");
			out.write("Content-Type: text/html\r\n");
			out.write("Content-Length: " + content.length() + "\r\n");
			out.write("Connection: close\r\n");
			
			
			out.write("\r\n");
			out.write(content);
			out.flush();
			
			this.clientSocket.close();
		} catch (IOException e) {
			e.printStackTrace();
		}
	}

	

}

package se.lnu.http;

import java.io.IOException;
import java.net.ServerSocket;
import java.net.Socket;
import java.net.SocketException;

public class AcceptThread extends Thread{

	volatile ServerSocket socket;
	volatile private HTTPServerObserver observer;
	public AcceptThread(Port port, HTTPServerObserver observer) throws IOException {
		socket = new ServerSocket(port.getPort()); 
		this.observer = observer;
	}
	
	public void stopme() throws IOException {
		socket.close();
	}
	
	public void run() {
        
        	
        	while (true) {
        		try {
        			observer.waitForClient();
        			Socket clientSocket = socket.accept();
        			ClientThread client = new ClientThread(clientSocket);
    				client.start();
    				observer.startedClient();
        		} catch (SocketException e) {
        			break;
                } catch (IOException e) {
        			e.printStackTrace();
                }
				
				
        	}
        	
        	observer.closedAccept();
        	
		
    } 
	
}
